        if (!([bool]($JsonParameters.PSobject.Properties.name -match "custom_column_ids"))) { #optional property not found
            $CustomColumnIds = $null
        } else {
            $CustomColumnIds = $JsonParameters.PSobject.Properties["custom_column_ids"].value
        }

        if (!([bool]($JsonParameters.PSobject.Properties.name -match "type"))) { #optional property not found
            $Type = $null
        } else {
            $Type = $JsonParameters.PSobject.Properties["type"].value
        }

        if (!([bool]($JsonParameters.PSobject.Properties.name -match "ingestion_sources"))) { #optional property not found
            $IngestionSources = $null
        } else {
            $IngestionSources = $JsonParameters.PSobject.Properties["ingestion_sources"].value
        }

        $PSO = [PSCustomObject]@{
            "id" = ${Id}
            "ad_account_id" = ${AdAccountId}
            "ad_account_ids" = ${AdAccountIds}
            "user_id" = ${UserId}
            "name" = ${Name}
            "report_start_relative_days_in_past" = ${ReportStartRelativeDaysInPast}
            "report_end_relative_days_in_past" = ${ReportEndRelativeDaysInPast}
            "date_range" = ${DateRange}
            "report_level" = ${ReportLevel}
            "report_format" = ${ReportFormat}
            "columns" = ${Columns}
            "granularity" = ${Granularity}
            "view_window_days" = ${ViewWindowDays}
            "click_window_days" = ${ClickWindowDays}
            "engagement_window_days" = ${EngagementWindowDays}
            "conversion_report_time_type" = ${ConversionReportTimeType}
            "filters_json" = ${FiltersJson}
            "is_owned_by_user" = ${IsOwnedByUser}
            "is_scheduled" = ${IsScheduled}
            "creation_source" = ${CreationSource}
            "is_deleted" = ${IsDeleted}
            "updated_time" = ${UpdatedTime}
            "custom_column_ids" = ${CustomColumnIds}
            "type" = ${Type}
            "ingestion_sources" = ${IngestionSources}
        }

        return $PSO
    }

}

